import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import {
    TableContainer,
    Table,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Typography,
    Paper,
    IconButton,
    Box,
    Collapse,
    Button,
    Checkbox
} from '@mui/material';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

const ProjectBank = () => {
    const { userId } = useParams();
    const [projects, setProjects] = useState([]);

    useEffect(() => {
        const fetchProjectBankData = async () => {
            try {
                const response = await axios.get(`http://localhost:8000/students/projectBank/${userId}`);
                setProjects(response.data);
            } catch (error) {
                console.error(error);
            }
        };

        fetchProjectBankData();
    }, [userId]);

    const handleLike = async (projectId, checked) => {
      console.log("projectId test:", projectId); // Check projectId value
      try {
          if (checked) {
              await axios.post(`http://localhost:8000/students/like`, { studentId: userId, projectId });
          } else {
              await axios.delete(`http://localhost:8000/students/like/${userId}/${projectId}`);
          }
      } catch (error) {
          console.error(error);
      }
  };
  

    const handleRequest = async() => {
      console.log("Request button");
    }
    
    const Row = ({ project }) => {
        const [open, setOpen] = useState(false);
        const [liked, setLiked] = useState(false);
        
        useEffect(() => {
            const checkLiked = async () => {
                try {
                    const response = await axios.get(`http://localhost:8000/students/like/${userId}/${project._id}`);
                    setLiked(response.data.liked);
                } catch (error) {
                    console.error(error);
                }
            };

            checkLiked();
        }, [userId, project._id]);

        return (
            <>
                <TableRow key={`${project._id}-details`}>
                    <TableCell>
                        <IconButton
                            aria-label="expand row"
                            size="small"
                            onClick={() => setOpen(!open)}
                        >
                            {open ? <KeyboardArrowUpIcon /> : <KeyboardArrowDownIcon />}
                        </IconButton>
                    </TableCell>
                    <TableCell component="th" scope="row">
                        {project.project_name}
                    </TableCell>
                    <TableCell>{project.project_description}</TableCell>
                    <TableCell>{project.project_type}</TableCell>
                    <TableCell>{project.project_domain}</TableCell>
                    <TableCell>{project.teacher_name}</TableCell>
                    <TableCell>{project.department}</TableCell>
                    <TableCell>{project.pre_requisites.join(', ')}</TableCell>
                    <TableCell>{project.cg_cutoff}</TableCell>
                    <TableCell>{project.cg_eligibility}</TableCell>
                    <TableCell>
                    <Checkbox
                          checked={liked}
                          onChange={(e) => {
                              console.log("projectId test:", project._id);
                              handleLike(project._id, e.target.checked);
                          }}
                      />
                    </TableCell>
                </TableRow>
                <TableRow>
                    <TableCell style={{ paddingBottom: 0, paddingTop: 0 }} colSpan={10}>
                        <Collapse in={open} timeout="auto" unmountOnExit>
                            <Box sx={{ margin: 1 }}>
                                <Typography variant="h6" gutterBottom component="div">
                                    Project Details
                                </Typography>
                                <Typography>{project.project_description}</Typography>
                                <Typography>{`Pre-requisites: ${project.pre_requisites.join(', ')}`}</Typography>
                                <Typography>{`CG Cutoff: ${project.cg_cutoff}`}</Typography>
                                <Typography>{`CG Eligibility: ${project.cg_eligibility}`}</Typography>
                                <Button onClick={handleRequest} variant="contained" color="primary">Request</Button>
                            </Box>
                        </Collapse>
                    </TableCell>
                </TableRow>
            </>
        );
    };

    return (
        <div>
            <h1>Project Bank</h1>
            <TableContainer component={Paper}>
                <Table aria-label="collapsible table">
                    <TableHead>
                        <TableRow>
                            <TableCell />
                            <TableCell>Project Name</TableCell>
                            <TableCell>Project Description</TableCell>
                            <TableCell>Project Type</TableCell>
                            <TableCell>Project Domain</TableCell>
                            <TableCell>Teacher Name</TableCell>
                            <TableCell>Department</TableCell>
                            <TableCell>Pre-requisites</TableCell>
                            <TableCell>CG Cutoff</TableCell>
                            <TableCell>CG Eligibility</TableCell>
                            <TableCell>Like</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                    {projects.map((project, index) => (
                        <Row key={project._id} project={project} />
                    ))}

                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    );
};

export default ProjectBank;
